import React, { useState } from 'react';
import axios from 'axios';

export default function HelpSharingAgent() {
  const [user, setUser] = useState<{ email: string; name?: string } | null>(null);
  const [sessionToken, setSessionToken] = useState<string | null>(null);
  const [message, setMessage] = useState('');
  const [dateTime, setDateTime] = useState('');
  const [loading, setLoading] = useState(false);

  async function createEvent() {
    if (!user || !sessionToken) {
      alert('Please log in first');
      return;
    }
    if (!message.trim() || !dateTime) {
      alert('Please enter a message and date/time');
      return;
    }

    setLoading(true);

    const event = {
      summary: 'Neighborhood Help Request',
      description: message.trim(),
      start: {
        dateTime: new Date(dateTime).toISOString(),
        timeZone: Intl.DateTimeFormat().resolvedOptions().timeZone,
      },
      end: {
        dateTime: new Date(new Date(dateTime).getTime() + 30 * 60000).toISOString(),
        timeZone: Intl.DateTimeFormat().resolvedOptions().timeZone,
      },
      reminders: { useDefault: true },
    };

    try {
      const response = await axios.post(
        '/api/create-event',
        { event, email: user.email },
        { headers: { Authorization: `Bearer ${sessionToken}` } }
      );
      alert(`Event created: ${response.data.summary} at ${new Date(response.data.start.dateTime).toLocaleString()}`);
      setMessage('');
      setDateTime('');
    } catch (err) {
      alert('Failed to create event. Please try again.');
      console.error(err);
    } finally {
      setLoading(false);
    }
  }

  return (
    <AuthProvider projectId="P321NcYgY3z0ACnbCyQyA3rWmY3V">
      <div
        style={{
          maxWidth: 500,
          margin: '40px auto',
          padding: 20,
          borderRadius: 10,
          boxShadow: '0 4px 12px rgba(0,0,0,0.1)',
          fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
        }}
      >
        <div style={{ textAlign: 'center', marginBottom: 20 }}>
          <img
            src="/logo192.png" // Place your logo here in public folder or URL
            alt="Neighborhood Help Logo"
            style={{ height: 60, marginBottom: 10 }}
          />
          <h1 style={{ margin: 0, fontWeight: 700, color: '#1473e6' }}>
            Neighborhood Help Coordinator
          </h1>
          <p style={{ color: '#666' }}>Connect with neighbors & share support easily</p>
        </div>

        {!user ? (
          <Descope
            flowId="help-agent-flow"
            theme="light"
            onSuccess={(e) => {
              setUser(e.detail.user);
              setSessionToken(e.detail.session.token);
              console.log('Signed in:', e.detail.user.email);
            }}
            onError={(err) => {
              alert('Authentication error. Please try again.');
              console.error('Descope error:', err);
            }}
          />
        ) : (
          <>
            <div style={{ marginBottom: 20, color: '#333' }}>
              Welcome, <strong>{user.name || user.email}</strong>! You’re signed in.
            </div>

            <textarea
              placeholder="Describe your help request or offer..."
              value={message}
              onChange={(e) => setMessage(e.target.value)}
              rows={4}
              style={{
                width: '100%',
                padding: 10,
                fontSize: 16,
                borderRadius: 6,
                border: '1px solid #ccc',
                resize: 'vertical',
                marginBottom: 15,
                boxSizing: 'border-box',
                fontFamily: 'inherit',
              }}
            />

            <input
              type="datetime-local"
              value={dateTime}
              onChange={(e) => setDateTime(e.target.value)}
              style={{
                width: '100%',
                padding: 10,
                fontSize: 16,
                borderRadius: 6,
                border: '1px solid #ccc',
                marginBottom: 20,
                boxSizing: 'border-box',
                fontFamily: 'inherit',
              }}
            />

            <button
              onClick={createEvent}
              disabled={loading}
              style={{
                width: '100%',
                backgroundColor: '#1473e6',
                color: 'white',
                padding: '12px 0',
                fontSize: 18,
                fontWeight: 'bold',
                border: 'none',
                borderRadius: 6,
                cursor: loading ? 'not-allowed' : 'pointer',
                transition: 'background-color 0.3s',
              }}
              onMouseEnter={e => !loading && (e.currentTarget.style.backgroundColor = '#0e56b4')}
              onMouseLeave={e => !loading && (e.currentTarget.style.backgroundColor = '#1473e6')}
            >
              {loading ? 'Creating Event...' : 'Create Help Event'}
            </button>

            <button
              onClick={() => {
                setUser(null);
                setSessionToken(null);
                setMessage('');
                setDateTime('');
              }}
              style={{
                width: '100%',
                marginTop: 15,
                backgroundColor: '#f44336',
                color: 'white',
                padding: '10px 0',
                fontSize: 16,
                borderRadius: 6,
                border: 'none',
                cursor: 'pointer',
              }}
            >
              Sign out
            </button>
          </>
        )}
      </div>
    </AuthProvider>
  );
}
